In step 18, the rotation matrix is defined as

 const double rotation[3][3]
= {{
t *axis[0] *axis[0]+c,
t *axis[0] *axis[1]+s *axis[2],
t *axis[0] *axis[2]-s *axis[1]
},
{
t *axis[0] *axis[1]-s *axis[2],
t *axis[1] *axis[1]+c,
t *axis[1] *axis[2]+s *axis[0]
},
{
t *axis[0] *axis[2]+s *axis[1],
t *axis[1] *axis[1]-s *axis[0],
t *axis[2] *axis[2]+c
}
};

However, entry (3,2) should be:
t *axis[1] *axis[2]-s *axis[0],
rather than:
t *axis[1] *axis[1]-s *axis[0],

as can be seen in http://www.gamedev.net/page/resources/_/technical/math-and-physics/do-we-really-need-quaternions-r1199

You may notice that entry (1,3) disagrees also between step-18 and http://www.gamedev.net/page/resources/_/technical/math-and-physics/do-we-really-need-quaternions-r1199, however there is a typo in that entry in http://www.gamedev.net/page/resources/_/technical/math-and-physics/do-we-really-need-quaternions-r1199 and step-18 is correct (as can be verified by checking the previous set of equations preceding the rotation matrix at http://www.gamedev.net/page/resources/_/technical/math-and-physics/do-we-really-need-quaternions-r1199).

DataPostprocessor currently declares virtual functions like this:
```
  virtual
  void
  compute_derived_quantities_scalar (const std::vector<double>         &uh,
                                     const std::vector<Tensor<1,dim> > &duh,
                                     const std::vector<Tensor<2,dim> > &dduh,
                                     const std::vector<Point<dim> >    &normals,
                                     const std::vector<Point<dim> >    &evaluation_points,
                                     std::vector<Vector<double> >      &computed_quantities) const;
```
The problem is that if we ever decide that we want to pass more information (e.g., the `material_id` of the cell on which we are currently evaluating, so that a user program can look up cell information), then this doesn't work: we can't just change the signature of the function to pass an additional value, since that would make user programs incompatible. In the past, we added a new virtual function with an extra argument whose default implementation just called the old function with the additional argument dropped. If a user overloads the old function, then it is called; if the user overloads the new function, then that works as well.

Clearly, this does not scale and we will be in trouble every time we want to add an argument. The way I envision this can be done in a reasonably extensible way is to declare them as follows:
```
  struct ScalarInputs {
      const std::vector<double>         uh,
      const std::vector<Tensor<1,dim> > duh,
      const std::vector<Tensor<2,dim> > dduh,
      const std::vector<Point<dim> >    normals,
      const std::vector<Point<dim> >    evaluation_points,
  };

  virtual
  void
  compute_derived_quantities_scalar (const ScalarInputs &scalar_inputs,
                                     std::vector<Vector<double> >      &computed_quantities) const;
```
Using such a scheme, we could add new fields to the `ScalarInputs` structure without breaking old programs -- they'd simply ignore the additional field, but it wouldn't affect the signature of the function and consequently the ability to overload.

